{%extends display.suMain%}



{%block pageContent%}
<div class="cbox">
  <pre>{{dataRow |dump}}</pre>
</div>

<table class="hide tbl1 v3 ltr fs12">
 <tbody>
{%for key, value in dataRow%}
  <tr id="r-{{key}}">
   <th class="">{{key}}</th>
   <td class="txtL">
   	{%if value%}
   	<pre>{{value}}</pre>
   	{%else%}
   	-
   	{%endif%}
   </td>
  </tr>
{%endfor%}
 </tbody>
</table>

{%endblock%}
